// Função para formatar o timestamp no formato brasileiro DD/MM/YYYY HH:mm:ss
function formatTimestamp(timestamp) {
    const date = new Date(timestamp);
    const options = {
        day: '2-digit',
        month: '2-digit',
        year: 'numeric',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit',
        hour12: false,
        timeZone: 'America/Fortaleza'
    };
    return date.toLocaleString('pt-BR', options).replace(',', ''); // Remove a vírgula entre data e hora
}

// Função para garantir que se uma lista estiver vazia, preencha com "N/A"
function fillWithNA(dataArray) {
    return dataArray.length > 0 ? dataArray : ["N/A"];
}

// Função para extrair participantes do tipo "AGENT" e dados de chamadas em estado "STARTING"
function extractAgentsAndCallData(items) {
    const participants = items[0].json.body.participants || []; // Acessa os participantes ou um array vazio
    const callStates = items[0].json.body.callStates || []; // Acessa estados das chamadas ou um array vazio

    // Inicializa os arrays para armazenar resultados
    let callData = [];

    // Iterar sobre os estados das chamadas para extrair dados
    callStates.forEach(state => {
        if (state.type === "STARTING") {
            callData.push({
                dataHora: formatTimestamp(state.timestamp), // Formata o timestamp
                participants: fillWithNA(state.participants.map(participant => {
                    // Extrai o nome, o número de extensão e o número do callee
                    return {
                        nameEmpresa: participant.type.name || "N/A",
                        numeroEmpresa: participant.type.number || "N/A",
                        numeroClient: participant.type.caller?.number || "N/A" // Utilizando optional chaining (?.)
                    };
                }))
            });
        }
    });

    // Preenche com "N/A" se agentes ou dados de chamadas estiverem vazios
    return {
        callData: fillWithNA(callData)
    };
}

// Função principal para processar os dados e retornar resultados
function processItems(items) {
    const results = [];
    const participantsData = items; // Recebe dados para processar como entrada

    // Verifica se o JSON contém a mensagem de erro
    if (participantsData[0].json.body.message === 'Nenhuma opção encontrada.') {
        results.push({ message: 'Nenhuma opção encontrada. Tente outra busca.' });
    } else {
        // Extract ramal and operador when destinationNumber is "1008"
        let participantsNumberData = []; // Inicializa array para armazenar números de destino

        // Itera por cada entrada de dados
        for (const data of participantsData) {
            // Acessa os estados de todos os participantes em cada estado da chamada
            for (const callState of data.json.body.callStates) {
                const participants = callState.participants; // Acessa a lista de participantes

                // Itera pelos participantes e coleta os dados quando o status é "IN_DIRECT_TRANSFER"
                for (const participant of participants) {
                    if (participant.status && participant.status.value === "IN_DIRECT_TRANSFER") {
                        // Acessa o número de destino e o nome do iniciador
                        const destinationNumber = participant.status.destination?.number || null;
                        const ramal = participant.status.initiator?.extensionNumber || null;
                        const operador = participant.status.initiator?.name || null;

                        // Verifica se o destinationNumber é igual a 1008
                        if (destinationNumber === "1000") {
                            // Cria um objeto com as informações do ramal e operador
                            const numberInfo = {
                                name: operador,
                                ramal: ramal
                            };

                            participantsNumberData.push(numberInfo); // Armazena os dados encontrados
                            break; // Para a execução após encontrar o primeiro registro com destinationNumber igual a 1008
                        }
                    }
                }
                // Encerra o loop das chamadas se um registro foi encontrado
                if (participantsNumberData.length > 0) {
                    break;
                }
            }
        }

        // Verifica os sistemas de resposta interativa
        const ivrs = participantsData[0].json.body.interactiveVoiceResponseSystems || [];
        const callStates = participantsData[0].json.body.callStates || [];

        // Verificando os estados de chamada para capturar possíveis opções
        callStates.forEach((state) => {
            if (state.interactiveVoiceResponseSystems) {
                state.interactiveVoiceResponseSystems.forEach((ivr) => {
                    // Verifica se o valor da opção está presente nos detalhes do nó
                    if (ivr.type.currentNode && ivr.type.currentNode.option) {
                        results.push({
                            id: ivr.id,
                            option: ivr.type.currentNode.option,
                            type: ivr.type.value
                        });
                    }
                });
            }
        });

        // Se nenhum sistema ou opção foi encontrado
        if (results.length === 0) {
            results.push({ message: 'Nenhuma opção disponível. A pesquisa não foi respondida.' });
        }

        // Retorna também os dados do ramal e operador quando destinationNumber é "1008"
        return {
            option: results,
            agents: participantsNumberData.slice(0, 1),
            callData: extractAgentsAndCallData(participantsData).callData
        };
    }

    // Retornar os dados processados
    const extractedData = extractAgentsAndCallData(items);
    return {
        option: results,
        callData: extractedData.callData
    };
}

// Chama a função principal e retorna os resultados
return processItems(items);

/**
 * Formata o timestamp no formato brasileiro DD/MM/YYYY HH:mm:ss
 * @param {string} timestamp - Data e hora em formato ISO
 * @returns {string} - Data formatada
 */
function formatTimestamp(timestamp) {
    const date = new Date(timestamp);
    const options = {
        day: '2-digit',
        month: '2-digit',
        year: 'numeric',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit',
        hour12: false,
        timeZone: 'America/Fortaleza'
    };
    return date.toLocaleString('pt-BR', options).replace(',', ''); // Remove a vírgula entre data e hora
}

/**
 * Preenche um array vazio com "N/A"
 * @param {Array} dataArray - Array de dados
 * @returns {Array} - Retorna o array ou ["N/A"]
 */
function fillWithNA(dataArray) {
    return dataArray.length > 0 ? dataArray : ["N/A"];
}

/**
 * Extrai participantes do tipo "LINE" e dados de chamadas em estado "ACTIVE"
 * @param {Array} items - Lista de itens do JSON
 * @returns {Object} - Contém agentes e dados de chamadas
 */
function extractAgentsAndCallData(items) {
    const participants = items[0].json.body.participants || [];
    const callStates = items[0].json.body.callStates || [];

    let agents = [];
    let callData = [];

    // Iterar sobre os participantes para extrair AGENTS
    participants.forEach(participant => {
        if (participant.type && participant.type.value === "LINE") {
            agents.push({
                name: participant.type.name || "N/A",
                ramal: participant.type.extensionNumber || "N/A"
            });
        }
    });

      // Iterar sobre os estados das chamadas para extrair dados
    callStates.forEach(state => {
        if (state.type === "ACTIVE") {
            const phoneNumbers = state.participants.filter(participant => participant.type.value === "PHONE_NUMBER");

            // Verifica se temos ao menos um PHONE_NUMBER e um LINE
            if (phoneNumbers.length > 0 && agents.length > 0) {
                // Pesquisa o primeiro participante com informações válidas
                const validParticipants = state.participants.map(participant => ({
                    nameEmpresa: participant.type.name || "N/A",
                    numeroEmpresa: participant.type.number || "N/A",
                    numeroClient: participant.type.callee?.number || "N/A"
                }));

                // Encontra o primeiro participante que não é "N/A"
                const firstValidParticipant = validParticipants.find(p => p.nameEmpresa !== "N/A" && p.numeroEmpresa !== "N/A" && p.numeroClient !== "N/A");

                // Se um participante válido for encontrado, adiciona à callData
                if (firstValidParticipant) {
                    callData.push({
                        dataHora: formatTimestamp(state.timestamp),
                        participants: [firstValidParticipant] // Armazena somente o primeiro participante válido
                    });
                }
            }
        }
    });

    return {
        agents: fillWithNA(agents),
        callData: fillWithNA(callData)
    };
}

/**
 * Processa os itens e retorna os resultados.
 * @param {Array} items - Lista de itens do JSON
 * @returns {Object} - Dados processados
 */
function processItems(items) {
    const results = [];

    if (items[0].json.body.message === 'Nenhuma opção encontrada.') {
        results.push({ message: 'Nenhuma opção encontrada. Tente outra busca.' });
    } else {
        const ivrs = items[0].json.body.interactiveVoiceResponseSystems || [];
        const callStates = items[0].json.body.callStates || [];

        callStates.forEach((state) => {
            state.interactiveVoiceResponseSystems?.forEach((ivr) => {
                if (ivr.type.currentNode && ivr.type.currentNode.option) {
                    results.push({
                        id: ivr.id,
                        option: ivr.type.currentNode.option,
                        type: ivr.type.value
                    });
                }
            });
        });

        if (results.length === 0) {
            results.push(null);
        }
    }

    const extractedData = extractAgentsAndCallData(items);
    return {
        option: results,
        agents: extractedData.agents,
        callData: extractedData.callData
    };
}

// Chama a função principal e retorna os resultados
return processItems(items);

